const TableRow = (props) =>{
    const tableRow = props.tableRow;
    const newdata = []
    for (const key in tableRow){
        if (key !== 'name'){
            newdata.push(key)
        }
    }
    console.log(newdata)
    return <tr>
        <td>{tableRow.name}</td>
        <td>
            <select >
                {newdata.map((batch) => batch)}
            </select>
            
            </td>
        <td>{tableRow.stock}</td>
        <td>{tableRow.deal}</td>
        <td>{tableRow.free}</td>
        <td>{tableRow.mrp}</td>
        <td>{tableRow.rate}</td>
        <td>{tableRow.exp}</td>
        
    </tr>
}
export default TableRow;
